INSERT INTO `book` (`id`, `title`, `author`, `description`, `image`) VALUES
(6, 'Animals in Translation: Using the Mysteries of Autism to Decode Animal Behavior', 'Temple Grandin, Catherine Johnson ', 'Why would a cow lick a tractor? Why are collies getting dumber? Why do dolphins sometimes kill for fun? How can a parrot learn to spell? How did wolves teach man to evolve?', );
INSERT INTO `book` (`id`, `title`, `author`, `description`, `image`) VALUES
(7, 'Traffic: Why We Drive the Way We Do (and What It Says About Us)', ' Tom Vanderbilt ', 'Would you be surprised that road rage can be good for society? Or that most crashes happen on sunny, dry days? That our minds can trick us into thinking the next lane is moving faster? Or that you can gauge a nation’s driving behavior by its levels of corruption? These are only a few of the remarkable dynamics that Tom Vanderbilt explores in this fascinating tour through the mysteries of the road. ', );
INSERT INTO `book` (`id`, `title`, `author`, `description`, `image`) VALUES
(8, 'The Curious Incident of the Dog in the Night-Time', 'Mark Haddon', 'Christopher John Francis Boone knows all the countries of the world and their capitals and every prime number up to 7,057. He relates well to animals but has no understanding of human emotions. He cannot stand to be touched. And he detests the color yellow.', );
INSERT INTO `book` (`id`, `title`, `author`, `description`, `image`) VALUES
(9, 'The Stranger', 'Albert Camus', 'Through the story of an ordinary man unwittingly drawn into a senseless murder on an Algerian beach, Camus explored what he termed "the nakedness of man faced with the absurd." First published in English in 1946; now in a new translation by Matthew Ward.', );
INSERT INTO `book` (`id`, `title`, `author`, `description`, `image`) VALUES
(10, 'Paris Spleen', 'Charles Baudelaire', 'Set in a modern, urban Paris, the prose pieces in this volume constitute a further exploration of the terrain Baudelaire had covered in his verse masterpiece, The Flowers of Evil: the city and its squalor and inequalities, the pressures of time and mortality, and the liberation provided by the sensual delights of intoxication, art, and women. Published posthumously in 1869, Paris Spleen was a landmark publication in the development of the genre of prose poetry—a format which Baudelaire saw as particularly suited for expressing the feelings of uncertainty, flux, and freedom of his age—and one of the founding texts of literary modernism.', );
INSERT INTO `book` (`id`, `title`, `author`, `description`, `image`) VALUES
(11, 'Math Curse', 'Jon Scieszka', 'Did you ever wake up to one of those days where everything is a problem? You have 10 things to do, but only 30 minutes until your bus leaves. Is there enough time? You have 3 shirts and 2 pairs of pants. Can you make 1 good outfit? Then you start to wonder: Why does everything have to be such a problem? Why do 2 apples always have to be added to 5 oranges? Why do 4 kids always have to divide 12 marbles? Why can''t you just keep 10 cookies without someone taking 3 away? Why? Because you''re a victim of the Math Curse. That''s why. But don''t despair. This is one girl''s story of how that curse can be broken.', );
INSERT INTO `book` (`id`, `title`, `author`, `description`, `image`) VALUES
(12, 'Thinking In Numbers: On Life, Love, Meaning, and Math', 'Daniel Tammet', 'THINKING IN NUMBERS is the book that Daniel Tammet, bestselling author and mathematical savant, was born to write. In Tammet''s world, numbers are beautiful and mathematics illuminates our lives and minds. Using anecdotes, everyday examples, and ruminations on history, literature, and more, Tammet allows us to share his unique insights and delight in the way numbers, fractions, and equations underpin all our lives.', );
INSERT INTO `book` (`id`, `title`, `author`, `description`, `image`) VALUES
(13, 'Dracula', 'Bram Stoker', 'Frederick Jaeger and Phyllis Logan star in this BBC Radio 4 full-cast dramatization of Bram Stoker’s classic horror novel. Summoned to the forbidding heart of the Carpathian mountains in Transylvania, Jonathan Harker journeys to Castle Dracula. There he becomes the unwitting prisoner of a mysterious nobleman whom local legend suggests is Nosferatu, the vampire, a night-stalking beast whose immortality depends on the slaking of his insatiable thirst for human blood. Able to transform himself at will into the shape of a wolf or bat, the evil Count sets sail for England on the scent of new and corruptible flesh. Meanwhile, Harker’s fiancée, Mina, is staying in Whitby when a great storm brings a shipwreck to the town. Suddenly Mina’s friend falls terribly ill. Could her fate be connected to what Harker found in Transylvania? As Count Dracula’s terrible secret is unearthed by the vampire hunter Van Helsing, a breathtaking chase across Europe ensues. . . With specially composed music and sound effects, this terrifying adaptation ably captures the atmosphere of brooding fear and dark eroticism present in Stoker’s original novel.', );
INSERT INTO `book` (`id`, `title`, `author`, `description`, `image`) VALUES
(14, 'Here I Am', 'Jonathan Safran Foer', 'In the book of Genesis, when God calls out, “Abraham!” to order him to sacrifice his son Isaac, Abraham responds, “Here I am.” Later, when Isaac calls out, “My father!” to ask him why there is no animal to slaughter, Abraham responds, “Here I am.”', );
INSERT INTO `book` (`id`, `title`, `author`, `description`, `image`) VALUES
(15, 'Swing Time', 'Zadie Smith', 'Two brown girls dream of being dancers - but only one, Tracey, has talent. The other has ideas: about rhythm and time, about black bodies and black music, what constitutes a tribe, or makes a person truly free. It''s a close but complicated childhood friendship that ends abruptly in their early twenties, never to be revisited, but never quite forgotten, either...\n', );
INSERT INTO `book` (`id`, `title`, `author`, `description`, `image`) VALUES
(16, 'On SF', 'Thomas M. Disch', 'This collection by the much-loved and lauded science-fiction writer Thomas Disch spans twenty-five years of his career, during which he has supplemented his creative output with reviews and critical essays in publications as diverse as the Nation, the New York Times Book Review, the Atlantic Monthly, and Twilight Zone.', );
INSERT INTO `book` (`id`, `title`, `author`, `description`, `image`) VALUES
(17, '334', 'Thomas M. Disch', 'If Charles Dickens has written speculative fiction, he might have created a novel as intricate, passionate, and lacerating as Thomas M. Disch''s visionary portrait of the underbelly of 21st-century New York City. The residents of the public housing project at 334 East 11th Street live in a world of rationed babies and sanctioned drug addiction. Real food is displayed in museums and hospital attendants moonlight as body-snatchers.', );
INSERT INTO `book` (`id`, `title`, `author`, `description`, `image`) VALUES
(18, 'Limbo', ' Bernard Wolfe', 'Although Bernard Wolfe has written several plays, most for television, it is principally for his 1952 science fiction novel Limbo that he''s best remembered. Penguin Books republished this work in a slightly abridged form in 1961, claiming it was "the first book of science fiction to project the present-day concept of ''cybernetics'' to its logical conclusion". Taken from this viewpoint, Limbo is an early example of the New Wave movement in science fiction, and could even be argued to be a precocious predecessor of the cyberpunk literature of the 1980s. Limbo takes place largely in the future year 1990: for that reason, its British editions are titled Limbo ''90.', );
INSERT INTO `book` (`id`, `title`, `author`, `description`, `image`) VALUES
(19, 'Modern Romance', 'Aziz Ansari, Eric Klinenberg ', 'At some point, every one of us embarks on a journey to find love. We meet people, date, get into and out of relationships, all with the hope of finding someone with whom we share a deep connection. This seems standard now, but it’s wildly different from what people did even just decades ago. Single people today have more romantic options than at any point in human history. With technology, our abilities to connect with and sort through these options are staggering. So why are so many people frustrated?', );
INSERT INTO `book` (`id`, `title`, `author`, `description`, `image`) VALUES
(20, 'The Drama of the Gifted Child: The Search for the True Self ', 'Alice Miller', 'As charming performers who skillfully reflect their parents expectations, far too many children grow into adults driven to greater and greater achievements by an underlying sense of worthlessness.', );
INSERT INTO `book` (`id`, `title`, `author`, `description`, `image`) VALUES
(21, 'Drama City', 'George Pelecanos', 'Lorenzo Brown just wants to stay straight. After eight years in prison on a drug charge, he''s come "uptown"-back to the Washington, DC neighborhood where he grew up, where his old cohorts still work their corners and their angles, trying to get ahead and stay alive. But Lorenzo''s had enough of the life: Now he has a job as a Humane Society officer, policing animal abusers and protecting the abused. In the dangerous streets he used to menace, Lorenzo plays a part in maintain- ing order-and it''s a role reversal some of his former friends don''t appreciate. Rachel Lopez, Lorenzo''s parole officer, tries to help him, even as she battles her own demons and excesses. Trying to stay one step ahead of her troubled past is a daily struggle. It looks like they both might make it, until a malevolent young killer, working for the powerful local drug boss, changes everything with one violent act. Now Lorenzo finds himself caught between the light and dark sides of the street, struggling to stay legit-or throw everything away to exact revenge.', );
INSERT INTO `book` (`id`, `title`, `author`, `description`, `image`) VALUES
(22, 'God Is Not Great: How Religion Poisons Everything', 'Christopher Hitchens', 'In the tradition of Bertrand Russell''s Why I Am Not a Christian and Sam Harris''s The End of Faith, Christopher Hitchens makes the ultimate case against religion. With a close and erudite reading of the major religious texts, he documents the ways in which religion is a man-made wish, a cause of dangerous sexual repression, and a distortion of our origins in the cosmos. Hitchens frames the argument for a more secular life based on science and reason, in which hell is replaced by the Hubble Telescope''s awesome view of the universe and Moses and the burning bush give way to the beauty and symmetry of the double helix.', );
INSERT INTO `book` (`id`, `title`, `author`, `description`, `image`) VALUES
(23, 'Waking Up: A Guide to Spirituality Without Religion', 'Sam Harris', 'For the millions of Americans who want spirituality without religion, Sam Harris’s new book is a guide to meditation as a rational spiritual practice informed by neuroscience and psychology.', );
INSERT INTO `book` (`id`, `title`, `author`, `description`, `image`) VALUES
(24, 'The C++ Programming Language', 'Bjarne Stroustrup', 'More than three-quarters of a million programmers have benefited from this book in all of its editions Written by Bjarne Stroustrup, the creator of C++, this is the world''s most trusted and widely read book on C++. For this special hardcover edition, two new appendixes on locales and standard library exception safety (also available at www.research.att.com/ bs/) have been added. The result is complete, authoritative coverage of the C++ language, its standard library, and key design techniques. Based on the ANSI/ISO C++ standard, " The C++ Programming Language " provides current and comprehensive coverage of all C++ language features and standard library components. For example: abstract classes as interfaces class hierarchies for object-oriented programming templates as the basis for type-safe generic software exceptions for regular error handling namespaces for modularity in large-scale software run-time type identification for loosely coupled systems the C subset of C++ for C compatibility and system-level work standard containers and algorithms standard strings, I/O streams, and numerics C compatibility, internationalization, and exception safety Bjarne Stroustrup makes C++ even more accessible to those new to the language, while adding advanced information and techniques that even expert C++ programmers will find invaluable. ', );
INSERT INTO `book` (`id`, `title`, `author`, `description`, `image`) VALUES
(25, 'History of Beauty', 'Umberto Eco, Girolamo De Michele', 'Now in paperback, Umberto Eco’s groundbreaking and much-acclaimed first illustrated book has been a critical success since its first publication in 2004. What is beauty? Umberto Eco, among Italy’s finest and most important contemporary thinkers, explores the nature, the meaning, and the very history of the idea of beauty in Western culture. The profound and subtle text is lavishly illustrated with abundant examples of sublime painting and sculpture and lengthy quotations from writers and philosophers. This is the first paperback edition of History of Beauty, making this intellectual and philosophical journey with one of the world’s most acclaimed thinkers available in a more compact and affordable format.', );
INSERT INTO `book` (`id`, `title`, `author`, `description`, `image`) VALUES
(26, 'Dragon''s Chid (The Mindbender''s Rise, #4)', 'D.J. Salisbury', 'Getting snatched by a dragon may not be a death sentence, but it certainly feels like one.\n\nWhile Viper struggles to learn enough magic to escape the dragon’s lair before the creature decides to eat him, Lorel, Tsai’dona, and Kyri battle through the mountains to locate and rescue him.', );
INSERT INTO `book` (`id`, `title`, `author`, `description`, `image`) VALUES
(27, 'Self Abidance', 'Srimati Margaret Coble, Sad Chid Anandam Brahman, Meernaidoo T. Somanah', 'I am honored and privileged to express my sincere appreciation for the sublime contents of: Self-Abidance written by an Enlightened Soul Srimati Margaret Coble. The sublime ideas embodied in this book have been made possible thanks to her present selfless deeds in the field of Yoga; besides her previous spiritual karmas are manifesting themselves to lead men, woman and children towards inner greatness. Many people have seen the Inner Light through her teachings. This book deals with Self-Analysis, the power, the deep meditation, the Divine Light, the Universal Love, the Bliss that pervades the souls of human beings, the height of inner perfection and the flood-gate of spirituality in practical action. Intellect fades away before the power of Spirit through which the possibility of Super-Consciousness is perfectly revealed. From the spiritual point of view all the Chapters of this book converge towards one focal point - the highest acme of Self-realization through Meditation and Self-inquiry. In Self-Abidance it is marvelously elucidated that contemplation upon the Flawless Infinite is the quickest and surest way of attaining Bliss and perennial happiness. One should not seek the shadows, oblivious of the Reality. I wholeheartedly endorse and recommend Self-Abidance to everybody inasmuch as it will render Divine service to the present generation as also to posterity. - Dr. Meernaidoo T. Somanah, Ph.D.', );
INSERT INTO `book` (`id`, `title`, `author`, `description`, `image`) VALUES
(28, 'Shadowland (The Mediator #1)', 'Meg Cabot', 'There''s a hot guy in Susannah Simon''s bedroom. Too bad he''s a ghost.\n\nSuze is a mediator - a liaison between the living and the dead. In other words, she sees dead people. And they won''t leave her alone until she helps them resolve their unfinished business with the living. But Jesse, the hot ghost haunting her bedroom, doesn''t seem to need her help. Which is a relief, because Suze has just moved to sunny California and plans to start fresh, with trips to the mall instead of the cemetery, and surfing instead of spectral visitations.', );
INSERT INTO `book` (`id`, `title`, `author`, `description`, `image`) VALUES
(29, 'Sapiens: A Brief History of Humankind', 'Yuval Noah Harari', '00,000 years ago, at least six human species inhabited the earth. Today there is just one. Us. Homo sapiens. How did our species succeed in the battle for dominance? Why did our foraging ancestors come together to create cities and kingdoms? How did we come to believe in gods, nations and human rights; to trust money, books and laws; and to be enslaved by bureaucracy, timetables and consumerism? And what will our world be like in the millennia to come? In Sapiens, Dr Yuval Noah Harari spans the whole of human history, from the very first humans to walk the earth to the radical – and sometimes devastating – breakthroughs of the Cognitive, Agricultural and Scientific Revolutions. Drawing on insights from biology, anthropology, palaeontology and economics, he explores how the currents of history have shaped our human societies, the animals and plants around us, and even our personalities. Have we become happier as history has unfolded? Can we ever free our behaviour from the heritage of our ancestors? And what, if anything, can we do to influence the course of the centuries to come? Bold, wide-ranging and provocative, Sapiens challenges everything we thought we knew about being human: our thoughts, our actions, our power ... and our future.', );
INSERT INTO `book` (`id`, `title`, `author`, `description`, `image`) VALUES
(30, 'A Brief History of Time', 'Stephen Hawking', 'In the ten years since its publication in 1988, Stephen Hawking''s classic work has become a landmark volume in scientific writing, with more than nine million copies in forty languages sold worldwide. That edition was on the cutting edge of what was then known about the origins and nature of the universe. But the intervening years have seen extraordinary advances in the technology of observing both the micro- and the macrocosmic worlds. These observations have confirmed many of Professor Hawking''s theoretical predictions in the first edition of his book, including the recent discoveries of the Cosmic Background Explorer satellite (COBE), which probed back in time to within 300,000 years of the universe''s beginning and revealed wrinkles in the fabric of space-time that he had projected. Eager to bring to his original text the new knowledge revealed by these observations, as well as his own recent research, Professor Hawking has prepared a new introduction to the book, written an entirely new chapter on wormholes and time travel, and updated the chapters throughout.', );
INSERT INTO `book` (`id`, `title`, `author`, `description`, `image`) VALUES
(31, 'The Hitchhiker''s Guide to the Galaxy', 'Douglas Adams', 'Seconds before the Earth is demolished to make way for a galactic freeway, Arthur Dent is plucked off the planet by his friend Ford Prefect, a researcher for the revised edition of The Hitchhiker''s Guide to the Galaxy who, for the last fifteen years, has been posing as an out-of-work actor.\n\nTogether this dynamic pair begin a journey through space aided by quotes from The Hitchhiker''s Guide ("A towel is about the most massively useful thing an interstellar hitchhiker can have") and a galaxy-full of fellow travelers: Zaphod Beeblebrox--the two-headed, three-armed ex-hippie and totally out-to-lunch president of the galaxy; Trillian, Zaphod''s girlfriend (formally Tricia McMillan), whom Arthur tried to pick up at a cocktail party once upon a time zone; Marvin, a paranoid, brilliant, and chronically depressed robot; Veet Voojagig, a former graduate student who is obsessed with the disappearance of all the ballpoint pens he bought over the years.', );
INSERT INTO `book` (`id`, `title`, `author`, `description`, `image`) VALUES
(32, 'Self-Help', 'Lorrie Moore', 'In these tales of loss and pleasure, lovers and family, a woman learns to conduct an affair, a child of divorce dances with her mother, and a woman with a terminal illness contemplates her exit. Filled with the sharp humor, emotional acuity, and joyful language Moore has become famous for, these nine glittering tales marked the introduction of an extravagantly gifted writer.', );
INSERT INTO `book` (`id`, `title`, `author`, `description`, `image`) VALUES
(33, 'The Goose Girl', 'Shannon Hale', 'Anidori-Kiladra Talianna Isilee, Crown Princess of Kildenree, spends the first years of her life under her aunt''s guidance learning to communicate with animals. As she grows up Ani develops the skills of animal speech, but is never comfortable speaking with people, so when her silver-tongued lady-in-waiting leads a mutiny during Ani''s journey to be married in a foreign land, Ani is helpless and cannot persuade anyone to assist her.\n\nBecoming a goose girl for the king, Ani eventually uses her own special, nearly magical powers to find her way to her true destiny. Shannon Hale has woven an incredible, original and magical tale of a girl who must find her own unusual talents before she can become queen of the people she has made her own.', );

